import { Tab, Tabs } from "react-bootstrap";

const CustomTab = () => {
  return (
    <Tabs
      defaultActiveKey="profile"
      id="uncontrolled-tab-example"
      className="mb-3"
    >
      <Tab eventKey="home" title="Home">
        <p>asd</p>
      </Tab>
      <Tab eventKey="profile" title="Profile">
        <p>dddd</p>
      </Tab>
    </Tabs>
  );
};

export default CustomTab;
